import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <div class="built-by">Built by <a href="https://goktug.bio/" target="_blank" rel="noopener noreferrer">Goktug</a>✌️</div>
  </React.StrictMode>
);
